function swap(geojson) {
    if (geojson.type === 'Feature') {
        swap(geojson.geometry);
    } else if (geojson.type === 'FeatureCollection') {
        geojson.features.forEach(function (feature) {
            swap(feature.geometry);
        });
    } else if (geojson.type === 'GeometryCollection') {
        geojson.geometries.forEach(function (geometry) {
            swap(geometry);
        });
    } else if (geojson.type === 'Point' || geojson.type === 'MultiPoint' || geojson.type === 'LineString' || geojson.type === 'MultiLineString' || geojson.type === 'Polygon' || geojson.type === 'MultiPolygon' || geojson.type === 'Polyline') {
        geojson.coordinates = swapLatLng(geojson.coordinates);
    } else {
        throw new Error('Unsupported GeoJSON type: ' + geojson.type);
    }
    return geojson;
}

function swapLatLng(coordinates) {
    if (Array.isArray(coordinates[0])) {
        return coordinates.map(swapLatLng);
    } else {
        return [coordinates[1] + 0.0027, coordinates[0] - 0.005];
    }
}

// aux functions
function getColor(sum) {
    return sum > 10000 ? '#700026' : sum > 7000 ? '#BD0026' : sum > 4000 ? '#E31A1C' : sum > 1500 ? '#FC4E2A' : sum > 1000 ? '#FD8D3C' : sum > 500 ? '#FEB24C' : sum > 300 ? '#FED976' : sum > 200 ? '#FFEDA0' : sum > 100 ? '#FFEEE0' : '#FFFFFF';
}

function setStyle(feature) {
    return {
        fillColor: getColor(feature), weight: 2, opacity: 1, color: 'white', dashArray: '3', fillOpacity: 0.7
    };
}


